• Ohayō my lovelies! 🍃💚
Long time no see! But I’m here today and I’m about to talk about a sweet and poetic game.~ 🌿 You guessed what I’m going to talk about; #NinnoKuni; #WrathoftheWhiteWitch~ 🧙🏻‍♀️ This game -if you never heard of it- was released in 2013 on PS3 I believe and this version has been remastered for the #NintendoSwitch. I’ve always been a massive fan of Studio Ghibli’s work. This game is just sooo pleasing for the eyes and the heart. I just started today but I’ve been playing all afternoon. 😂 I can’t wait to discover what’s next in this beautiful adventure! Plus, the music is magical, even if it’s not surprising because Mr#JoeHisaishi made it. The game seems really complete and I’m sincerely enjoying it a lot so far. 💚 Really well done @ the developers! I’ll probably try to keep you guys updated about my advancement~ I wish you a lot a great evening, and please remember, I love you all! 🌈💚🐸
♡ ♡ ♡
