What is your worst game you ever played? (Any consoles!) Today my gaming post will be a little bit different. Today I gonna talk about my worst game ever on my Switch 😂

Ben 10.... I know that it is a game for kids who love Ben 10 series.

It is totally the worst game ever for me in my 2019! Glitchy, repetitive gameplay, and very uninteresting graphic. 😂

Here is my story why I got this game.

Yesterday, I went to my regular game shop. Currently, the shop has a donation campaign for people who are suffered from flooding in the Northeast of Thailand. So I participated the event by donating 180 packs of instant noodles and one sack of rice because I really want to help people who are suffered. As for donation prize, I will get a Playstation shirt and two specific Switch games including Mario + Rabbids and...... Ben 10. 
I don't expect much from this game really. I think I will play it when I want to relax from games like Octopath or Resident Evil. But once I got a glimpse on this game.... It is worse than I expected. 😂 Repetitive gameplay, clunky control, crispy graphic, short overall story mode. But I got this game for my charity price, so no hard feelings 😂

This game is suitable for kids by the way.

